import './Header.css'


const HeaderTitle = () => {
    return(
    <h1>
        <a href="../" className="titleBig">PORTFOLIO</a>
    </h1>
    )
}


const HeaderNav = (props) => {
    return(
        <nav>
            <ul className="titlePages-group">
                <li>
                    <a href="./"
                    className="titlePages">
                        Home
                    </a>
                    {props.page && (
                        <div class="circle"></div>
                    )}
                </li>
                <li>
                    <a href="./Projects"
                    className="titlePages">
                        Projects
                    </a>
                </li>
                <li>
                    <a href="./Activities"
                    className="titlePages">
                        Activities
                    </a>
                </li>
            </ul>
        </nav>
    )
}


// main関数
function Header () {
    return (
        <header>
            <HeaderTitle />
            <HeaderNav page="home" />
        </header>
    );
}
export default Header;
